import React, {Component} from 'react';

import TraderTable from './TraderTable';
import NavBar from './NavBar';


class HomePage extends Component{
    render() {

        return(
            <div>
                <NavBar />
                <TraderTable />
            </div>
        );
    }
}
export default HomePage;
